INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1001, 1, 0, "春咲 ひより", 0, 0, 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "みんなみたいに\nわたしも強くならなきゃ", 0, 1002, 1, 0, "草野 優衣", 0, 0, 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "フェンシングを始めてみては？", 0, 1003, 1, 0, "士条 怜", 0, 0, 2, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "ねぇ、にいちゃん！", 0, 1004, 1, 0, "穂高 みそぎ", 0, 0, 2, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "風宮あかりです", 0, 1006, 1, 0, "風宮 あかり", 0, 0, 2, "私といっしょに…\nいかない？", "ねぇ…", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "出雲宮子なのー", 0, 1007, 1, 0, "出雲 宮子", 0, 0, 2, "食べ物の恨みは怖いのー", "プリンたべたいのー", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "ボクは虹村雪。", 0, 1008, 1, 0, "虹村 雪", 0, 0, 2, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "フッ…聞いて後悔するがいい！", 0, 1009, 1, 0, "柊杏奈", 0, 0, 2, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1010, 1, 0, "姫宮 真歩", 0, 0, 2, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "衣之咲璃乃です！", 0, 1011, 1, 0, "衣之咲 璃乃", 0, 0, 2, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1012, 1, 0, "柏崎 初音", 0, 0, 2, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "ちょす！\n美波鈴奈だよ～♪", 0, 1016, 1, 0, "美波 鈴奈", 0, 0, 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "はいたーい。\n喜屋武香織さー。", 0, 1017, 1, 0, "喜屋武 香織", 0, 0, 2, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "支倉伊緒です。", 0, 1018, 1, 0, "支倉 伊緒", 0, 0, 2, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1020, 1, 0, "茜 ミミ", 0, 0, 2, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1021, 1, 0, "栗林 くるみ", 0, 0, 2, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "風宮よりです。\nあああああ！", 0, 1022, 1, 0, "風宮 より", 0, 0, 2, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1023, 1, 0, "北条 綾音", 0, 0, 2, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "わっ…わっ…私、\n天野すずめといいます！", 0, 1025, 1, 0, "天野 すずめ", 0, 0, 2, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "……クスクス…私は\n…倉石恵理子……", 0, 1027, 1, 0, "倉石 恵理子", 0, 0, 2, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1028, 1, 0, "佐々木 咲恋", 0, 0, 2, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "桜井望だよ！\nよろしくねっ", 0, 1029, 1, 0, "桜井 望", 0, 0, 2, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "デケデケデンっ！", 0, 1030, 1, 0, "ニノン・ジュベール", 0, 0, 2, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "上喜しのぶです。\n手元のドクロが父です。", 0, 1031, 1, 0, "上喜 しのぶ", 0, 0, 2, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1033, 1, 0, "野戸まひる", 0, 0, 2, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1034, 1, 0, "綾瀬 ゆかり", 0, 0, 2, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "氷川鏡華…です", 0, 1036, 1, 0, "氷川 鏡華", 0, 0, 2, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "柏崎…栞です。", 0, 1038, 1, 0, "柏崎 栞", 0, 0, 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "ふ、双葉碧です。", 0, 1040, 1, 0, "双葉 碧", 0, 0, 2, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "三角千歌です。", 0, 1042, 1, 0, "三角 千歌", 0, 0, 2, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "安芸真琴だ。", 0, 1043, 1, 0, "安芸 真琴", 0, 0, 2, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "わらわこそは夜を総べる者！", 0, 1044, 1, 0, "イリヤ・オーンスタイン", 0, 0, 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "そこで騎士は妖精を乱暴に……", 0, 1045, 1, 0, "遠見 空花", 0, 0, 2, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1046, 1, 0, "宮坂たまき", 0, 0, 2, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "大神美冬よ！", 0, 1048, 1, 0, "大神 美冬", 0, 0, 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "星野静流だよ！", 0, 1049, 1, 0, "星野静流", 0, 0, 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "アタシは玉泉美咲。", 0, 1050, 1, 0, "玉泉美咲", 0, 0, 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "？？？", 0, 1052, 1, 0, "リマ", 0, 0, 2, "？？？？", "？？？？", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1053, 1, 0, "モニカ・ヴァイスヴィント", 0, 0, 2, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1058, 1, 0, "ペコリーヌ", 0, 0, 2, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1059, 1, 0, "コッコロ", 0, 0, 2, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1, "モニカ・ヴァイスヴィントだ。", 0, 1060, 1, 0, "キャル", 0, 0, 2, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 1.5, 1);
